import React from 'react';

import {
    RowSection,
    SectionTitle,
    RedAsterisk,
    RegisterInput
} from '../static/StyledComponents';

const FormInputSection = props => {
    return (
        <React.Fragment>
            <RowSection>
                <SectionTitle>{props.title}</SectionTitle>
                <RedAsterisk>*</RedAsterisk>
            </RowSection>
            <RegisterInput width="20%" />
        </React.Fragment>
    );
};

export default FormInputSection;
